    <div id=""aboutMeHobbies"">
        <h3 class=""text-center"">Hobbies</h3>
        <p>My favorite hobbies are: Sports, Web Development, Finance. Sports is my number 1 with my favorite being football, Go Huskies!! Go Packers!! followed by basketball then soccer.
        <br><br>
        Web Developement has become one of my most recent new hobbies. I enjoy learning new tech, methods, and frameworks that allow programmers to develop awesome entertaining or productivity applications. The vast amount of technology and rate of new technologies created allows for continuous education, always something to learn, never allowing for a dull moment. Always something new to engineer for better efficiency and user experience. I love the problem solving challenges that developers must face to complete their goals, the challenges allow me to use my analytical skills, critical thinking skills and desire for problem solving to be creative with my technical skills in an extraordinary way.
        <br><br>
        Lastl");
            WriteLiteral(@"y Finance! I have always had a somewhat keen knowledge of Money. As a child I would always be intrigued by money, how it works, how to use it best, and get more of it. As a result I grew up learning to become frugal. Finance is an important subject to learn in today's society, I am just sad to see the educational system not addressing this topic as well as it needs to. Let's address an important date in all our American lives. When you turn 18, you become an adult and society deems you an adult ready and responsible enough to face the world. Let me ask you, did you know how credit cards worked, investing, 401K, interest rates, bonds, stocks, loans, budgeting, saving, etc... all during highschool? Most will answer no, which is a problem and creates barriers. Anyways, I have come to love finance after learning about investing, you see there are 3 main things that have motivated me to invest. 1.) The Great Recession: never truly understood economics nor how markets work but the impact of that recession made me w");
            WriteLiteral(@"ant to learn to prevent personal financial disaster, 2.) College: Education in economics and accounting courses taught me how money functions in this world, 3.) Working in Social Services: I worked with elderly low-income public clients, learned from their financial retirement mistakes and listened carefully to their financial stories. I wanted to ensure I would never experience the same situations. My favorite book is The Intelligent Investor by Benjamin Graham. An excellent book on value investing, an instrinstic approach written by the man who mentored one of the richest men in the world today, Warren Buffett.
